  return (
    <div className="wrapsearch">


<input type="text"  required="required" placeholder="example: animals"></input>
    <input type="button"  value="Search" />
<div className="clearfon"><h1>Bведите запрос.</h1></div>
    </div>
  );
};
export { routeSearch };
export default SearchPage;
